import Login from "./Components/Login/Login"
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
         <Website />
        </Route>
      </Routes>
    </BrowserRouter>

    </div>
  );
}

export default App;
